I am using adaptive card in my bot and I want to change the background color of the card. I am using the following code to create the card:
```
var card = new AdaptiveCards.AdaptiveCard(new AdaptiveCards.AdaptiveSchemaVersion(1,1));
card.Speak = "Hello";
card.Body.AddTextBlock(new AdaptiveCards.TextBlock()
{
    Text = "Hello",
    Color = AdaptiveCards.TextColor.Default,
    IsSubtle = false,
    Weight = AdaptiveCards.TextWeight.Bolder
});
```
I want to change the background color of the card. How can I do that?

Answer: You can change the background color of an Adaptive Card by adding a `Container` element to the card's `Body` and setting its `Background` property.

Here is an example:
```
var card = new AdaptiveCards.AdaptiveCard(new AdaptiveCards.AdaptiveSchemaVersion(1, 1));
card.Speak = "Hello";
card.Body.AddContainer(new AdaptiveCards.Container()
{
    Items = new List<AdaptiveCards.Element>()
    {
        new AdaptiveCards.TextBlock()
        {
            Text = "Hello",
            Color = AdaptiveCards.TextColor.Default,
            IsSubtle = false,
            Weight = AdaptiveCards.TextWeight.Bolder
        }
    },
    Background = new AdaptiveCards.Background()
    {
        Color = "#FF0000" // red color
    }
});
```
In this example, the `Container` element is added to the card's `Body`, and its `Background` property is set to a `Background` object with a `Color` property set to `#FF0000` (red color). The `TextBlock` element is then added to the `Container` element's `Items` collection.

You can change the `Color` property of the `Background` object to any valid hex color code to change the background color of the card.

