 I'm trying to use React Context to achieve this.

Here is my code:

\begin{code}
import React, from 'react';

const TooltipContext = React.createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = React.useState(null);

  const openTooltip = (tooltip) => {
    setTooltip(tooltip);
  };

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ tooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

const useTooltip = () => {
  return React.useContext(TooltipContext);
};

const Tooltip = ({ children }) => {
  const { tooltip, openTooltip, closeTooltip } = useTooltip();

  const handleMouseOver = () => {
    openTooltip(children);
  };

  const handleMouseOut = () => {
    closeTooltip();
  };

  return (
    <div onMouseOver={handleMouseOver} onMouseOut={handleMouseOut}>
      {children}
    </div>
  );
};

const App = () => {
  return (
    <TooltipProvider>
      <Tooltip>Tooltip 1</Tooltip>
      <Tooltip>Tooltip 2</Tooltip>
    </TooltipProvider>
  );
};
\end{code}

However, this code doesn't work as expected. When I hover over `Tooltip 1`, it opens the tooltip, but when I hover over `Tooltip 2`, it doesn't close the previously opened tooltip. It seems like the state is not being updated correctly.

I'm not sure what's going on. Can someone help me out?

Answer:
The problem is that you're storing the actual tooltip content in the state, which is not necessary. Instead, you should store a unique identifier for each tooltip, and then use that identifier to determine which tooltip to display.

Here's the corrected code:

\begin{code}
import React from 'react';

const TooltipContext = React.createContext();

const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = React.useState(null);

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

const useTooltip = () => {
  return React.useContext(TooltipContext);
};

const Tooltip = ({ children, id }) => {
  const { activeTooltip, openTooltip, closeTooltip } = useTooltip();

  const handleMouseOver = () => {
    openTooltip(id);
  };

  const handleMouseOut = () => {
    closeTooltip();
  };

  return (
    <div onMouseOver={handleMouseOver} onMouseOut={handleMouseOut}>
      {activeTooltip === id && children}
    </div>
  );
};

const App = () => {
  return (
    <TooltipProvider>
      <Tooltip id="tooltip-1">Tooltip 1</Tooltip>
      <Tooltip id="tooltip-2">Tooltip 2</Tooltip>
    </TooltipProvider>
  );
};
\`

This way, when you hover over a tooltip, it sets the active tooltip to the current one, and when you hover out, it sets the active tooltip to null. The tooltip content is only displayed when the active tooltip matches the current tooltip's id.

I hope this helps! Let me know if you have any questions or need further clarification.
\end{code}

